
DROP DATABASE IF EXISTS FoodDeliveryMarketAnalysis;
CREATE DATABASE IF NOT EXISTS FoodDeliveryMarketAnalysis;
USE FoodDeliveryMarketAnalysis;
-- Table: DeliveryPartners
CREATE TABLE Delivery_Partners (
    DeliveryPartnerID INT PRIMARY KEY,
    Name VARCHAR(50),
    City VARCHAR(50),
    Region VARCHAR(50)
);
-- Table: Restaurants
CREATE TABLE Restaurants (
    RestaurantID INT PRIMARY KEY,
    Name VARCHAR(100),
    City VARCHAR(50),
    Cuisine VARCHAR(50),
    Rating DECIMAL(3, 2) CHECK(Rating <= 5),
    OpeningHours TIME,
    ClosingHours TIME
);
-- Table: Menu_Items
CREATE TABLE Menu_Items (
    ItemID INT PRIMARY KEY,
    RestaurantID INT,
    ItemName VARCHAR(100),
    Description TEXT,
    Price DECIMAL(8, 2)
);
-- Table: Promotions
CREATE TABLE Promotions (
    PromotionID INT PRIMARY KEY,
    RestaurantID INT,
    PlatformID INT,
    Description TEXT,
    ValidFrom DATE,
    ValidTo DATE
);
-- Table: Reviews
CREATE TABLE Reviews (
    ReviewID INT PRIMARY KEY,
    PlatformID INT,
    CustomerID INT,
    RestaurantID INT,
    Rating DECIMAL(3, 2) CHECK(Rating <= 5),
    Feedback TEXT,
    ReviewDate DATE
);
-- Table: Platforms
CREATE TABLE Platforms (
    PlatformID INT PRIMARY KEY,
    Name VARCHAR(50),
    CommissionRate DECIMAL(5, 2)
);
-- Table: Restaurant_Platform
CREATE TABLE Restaurant_Platform (
    RestaurantID INT,
    PlatformID INT,
    JoinDate DATE
);
-- Table: Customers
CREATE TABLE Customers (
    CustomerID INT PRIMARY KEY,
    Name VARCHAR(50),
    City VARCHAR(50),
    Region VARCHAR(50),
    JoinedDate DATE
);
-- Table: OrderDetails
CREATE TABLE Order_Details (
    OrderID INT PRIMARY KEY,
    CustomerID INT,
    PlatformID INT,
    ItemID INT,
    OrderDate DATETIME,
    DeliveryTime TIME,
    TotalPrice DECIMAL(8, 2)
);
-- Table: Payments
CREATE TABLE Payments (
    PaymentID INT PRIMARY KEY,
    OrderID INT,
    DiscountID INT,
    PaymentMethod ENUM(
        'UPI',
        'Net Banking',
        'Credit Card',
        'Debit Card',
        'Wallet'
    ),
    Status ENUM('Pending', 'Success', 'Failed'),
    TransactionDetails TEXT,
    TransactionDate DATETIME
);
-- Table: Discounts
CREATE TABLE Discounts (
    DiscountID INT PRIMARY KEY,
    PlatformID INT,
    PromoCode VARCHAR(50),
    Description TEXT,
    ValidFrom DATE,
    ValidTo DATE
);
-- Table: DeliveryRoutes
CREATE TABLE Delivery_Routes (
    RouteID INT PRIMARY KEY AUTO_INCREMENT,
    OrderID INT,
    DeliveryPartnerID INT,
    StartTime DATETIME,
    EndTime DATETIME
);
-- Table: PlatformFeatures
CREATE TABLE Platform_Features (
    FeatureID INT PRIMARY KEY,
    PlatformID INT,
    FeatureName VARCHAR(100),
    Description TEXT
);


