    ADD FOREIGN KEY (PlatformID) REFERENCES Platforms(PlatformID),
    ADD PRIMARY KEY (RestaurantID, PlatformID);
ALTER TABLE Order_Details
ADD FOREIGN KEY (CustomerID) REFERENCES Customers(CustomerID),
    ADD FOREIGN KEY (PlatformID) REFERENCES Platforms(PlatformID),
    ADD FOREIGN KEY (ItemID) REFERENCES Menu_Items(ItemID);
ALTER TABLE Payments
ADD FOREIGN KEY (OrderID) REFERENCES Order_Details(OrderID),
    ADD FOREIGN KEY (DiscountID) REFERENCES Discounts(DiscountID);
ALTER TABLE Discounts
ADD FOREIGN KEY (PlatformID) REFERENCES Platforms(PlatformID);
ALTER TABLE Delivery_Routes
ADD FOREIGN KEY (OrderID) REFERENCES Order_Details(OrderID),
    ADD FOREIGN KEY (DeliveryPartnerID) REFERENCES Delivery_Partners(DeliveryPartnerID);
ALTER TABLE Platform_Features
ADD FOREIGN KEY (PlatformID) REFERENCES Platforms(PlatformID);